(80, 1, '2018-10-27 04:07:37', '2018-10-27 04:07:37', 'The young team of Franziska Hildebrand, Franziska Preuss, Vanessa Hinz and Dahlmeier clocked 1 hour, 11 minutes, 54.6 seconds to beat France by just over 1 minute. Italy took bronze, 1:06.1 behind. Germany missed six targets overall, avoiding any laps around the penalty loop. Maria Dorin Habert of France, who has two individual gold medals at these worlds, passed Russia and France on the last leg and to take her team from fourth to second.', 'Women’s Relay Competition', '', 'publish', 'open', 'open', '', 'womens-relay-competition', '', '', '2018-10-27 04:07:37', '2018-10-27 04:07:37', '', 0, 'https://greefrunners.co.za//?p=80', 0, 'post', '', 0),
