(87, 1, '2018-10-27 04:07:37', '2018-10-27 04:07:37', 'Fusce non nunc mi. Integer placerat nulla id quam varius dapibus. Nulla sit amet tellus et purus lobortis efficitur. Vivamus tempus posuere ipsum in suscipit. Quisque pulvinar fringilla cursus. Morbi malesuada laoreet dui, vitae consequat arcu vehicula vel. Fusce vel turpis non ante mollis bibendum a ac risus. Morbi ornare ipsum sit amet enim rhoncus, sed eleifend felis tristique. Mauris sed sollicitudin libero. In nec lacus quis erat rhoncus molestie.', 'Get more nutrition in every bite', '', 'inherit', 'closed', 'closed', '', '79-revision-v1', '', '', '2018-10-27 04:07:37', '2018-10-27 04:07:37', '', 79, 'https://greefrunners.co.za//2018/10/27/79-revision-v1/', 0, 'revision', '', 0),
(88, 1, '2018-10-27 04:07:37', '2018-10-27 04:07:37', 'The young team of Franziska Hildebrand, Franziska Preuss, Vanessa Hinz and Dahlmeier clocked 1 hour, 11 minutes, 54.6 seconds to beat France by just over 1 minute. Italy took bronze, 1:06.1 behind. Germany missed six targets overall, avoiding any laps around the penalty loop. Maria Dorin Habert of France, who has two individual gold medals at these worlds, passed Russia and France on the last leg and to take her team from fourth to second.', 'Women’s Relay Competition', '', 'inherit', 'closed', 'closed', '', '80-revision-v1', '', '', '2018-10-27 04:07:37', '2018-10-27 04:07:37', '', 80, 'https://greefrunners.co.za//2018/10/27/80-revision-v1/', 0, 'revision', '', 0),
(89, 1, '2018-10-27 04:07:38', '2018-10-27 04:07:38', 'Chocolate bar marzipan sweet marzipan. Danish tart bear claw donut cake bonbon biscuit powder croissant. Liquorice cake cookie. Dessert cotton candy macaroon gummies sweet gingerbread sugar plum. Biscuit tart cake. Candy jelly ice cream halvah jelly-o jelly beans brownie pastry sweet. Candy sweet roll dessert. Lemon drops jelly-o fruitcake topping. Soufflé jelly beans bonbon.', 'A Paradise for Holiday', '', 'inherit', 'closed', 'closed', '', '81-revision-v1', '', '', '2018-10-27 04:07:38', '2018-10-27 04:07:38', '', 81, 'https://greefrunners.co.za//2018/10/27/81-revision-v1/', 0, 'revision', '', 0),
(90, 1, '2018-10-27 04:07:38', '2018-10-27 04:07:38', 'Nunc consectetur ipsum nisi, ut pellentesque felis tempus vitae. Integer eget lacinia nunc. Vestibulum consectetur convallis augue id egestas. Nullam rhoncus, arcu in tincidunt ultricies, velit diam imperdiet lacus, sed faucibus mi massa vel nunc. In ac viverra augue, a luctus nisl. Donec interdum enim tempus, aliquet metus maximus, euismod quam. Sed pretium finibus rhoncus. Phasellus libero diam, rutrum non ipsum ut, ultricies sodales sapien. Duis viverra purus lorem.', 'Destruction in Montania', '', 'inherit', 'closed', 'closed', '', '82-revision-v1', '', '', '2018-10-27 04:07:38', '2018-10-27 04:07:38', '', 82, 'https://greefrunners.co.za//2018/10/27/82-revision-v1/', 0, 'revision', '', 0),
